import React from 'react';
import ReactDOM from 'react-dom';
import './Levels.css';
import './Question.js';
import './Questions.json';

function Levels() {
    var newButtons = [];
    for (var i=1; i<101; i++) {
        newButtons.push(<button key={i} type="button" id={i} onClick={
            ReactDOM.render(<React.StrictMode><Question /></React.StrictMode>, document.getElementById("root"))
        }>{i}</button>);
    }
    return (
        <div>
            <button type="button" className="leftArrow">&larr;</button>
            <div className="container">
                <div className="levels">
                    <h1>Levels</h1>         
                    {newButtons}
                </div>
            </div>
        </div>
    );
}

export default Levels;
